import React from 'react'
import Ratio from 'react-bootstrap/Ratio';
import Row from 'react-bootstrap/Row';
import Container from 'react-bootstrap/Container';
import Col from 'react-bootstrap/Col';
import "../Maplocation/Maplocation.css"

const Maplocation = () => {
  return (
    <>
      <Container>
        <h3>Location</h3>
        <Row >
          <Col  >
            <div className='d-flex justify-content-md-center align-items-center mt-4'>
              <Ratio aspectRatio="16x9" style={{ width: '100%' }}>
                <iframe
                  src="https://maps.google.com/maps?q=sukarame bandar lampung&t=&z=17&ie=UTF8&iwloc=&output=embed" frameorder="0" marginHeight="0" marginWidth="0"
                  style={{ border: '1px ' }}
                >
                </iframe>
              </Ratio>
            </div>
          </Col>
        </Row>
      </Container>


    </>
  )
}
export default Maplocation;
